import React, { Component } from "react";
import { Link } from "react-router-dom";
import ProjectNav from "./ProjectNav.js";
import "../App.css";
import "../Responsive.css";
import "../Hamburgers.css";
import img01 from "../img/prismvideo-img01.png";
import img00 from "../img/prismvideo-img02.png";

class PrismVideo extends Component {
  state = {
    logoImage: img00,
  };

  componentDidMount() {
    window.scrollTo(0, 0);
  }

  render() {
    return (
      <section className="project-content prismvideo">
        <div className="cover">
          <ProjectNav
            logoColor="#E0E0E0"
            menuColor="#E0E0E0"
            logo={this.state.logoImage}
            title={["PRISM Live Studio", <br />, "Video Editing Redesign"]}
            domain="Mobile Application"
            roles="UX: Sun Lee, Kayla Bell"
            rolesTwo="UI: Jiyoung Park, Youngok Choi, Goeun Han"
            date="2018.07 - 2018.09"
            firm="NAVER Corp."
          />
          <img src={img01} alt="Cover" className="cover-image" />
        </div>

        <div className="thanks">
          <div className="thanks-text">Thanks for watching!</div>
          <div className="link">
            <a
              href="http://prismlive.com/en_us/mapp/"
              target="_blank"
              rel="noopener noreferrer"
            >
              www.prismlive.com
            </a>
          </div>
          <form
            action="http://prismlive.com/en_us/mapp/"
            method="get"
            target="_blank"
            className="download"
          >
            <button type="submit" className="download-button">
              DOWNLOAD APP
            </button>
          </form>
        </div>
        <div className="bottom-navigation">
          <Link to="/prismvideo" className="link link-active">
            PRISM Video Editing Redesign
          </Link>
          <Link to="/prismlayout" className="link link-inactive">
            PRISM Layout Redesign
          </Link>
          <Link to="/schole" className="link link-inactive">
            Scholé Website Renewal
          </Link>
          <Link to="/framer30" className="link link-inactive">
            30 Days of Framer X
          </Link>
        </div>
      </section>
    );
  }
}

export default PrismVideo;
